import axios from "axios";
import {CREATE_USER} from '../Constants/constants';

export default function createUser(user) {
    const dataUser = {
        email: userData.email,
        //'prueba6@gmail.com',
        
        password: userData.password,
        //'abcd1234$',
        
        repeatPass: userData.repeatPass,
        //'abcd1234$',
    
    };
    return (dispatch) => {
      // console.log(BACK_URL);
      console.log('soy dataUser-------------', dataUser)
  
      axios
        .post('http://192.168.0.19:3001/users', dataUser)
        //console.log('soy dataUser2-------------', dataUser)
        .then((res) => {
          console.log('soy res-------------', res);
          dispatch({
            type: CREATE_USER,
            users: res.data || {},
            createUserSuccess: true,
          })
        })
          .catch((error) => {
            console.log(error);
          })
        }
}
